db.contents.insertOne({ categories: [ ObjectId("5de8a19612f1876c9365ea47") ], tags: [ ObjectId("5de8138110322c613229c52a"), ObjectId("5de80f6110322c613229c502") ], isSeries: false, country: [ ObjectId("5de8b686641f4253ad09d301"), ObjectId("5de8b686641f4253ad09d27a"), ObjectId("5de8b686641f4253ad09d2ff"), ObjectId("5de8b686641f4253ad09d2b9"), ObjectId("5de8b686641f4253ad09d2ca"), ObjectId("5de8b686641f4253ad09d2cf"), ObjectId("5de8b686641f4253ad09d2f8") ], subCategories: [ ObjectId("5de8db0ccc446376c1110e7c") ], isFree: true, isFreeForAzam: true, status: true, packageID: [], isDeleted: false, isEpisode: false, images: [], _id: ObjectId("5dfd2d09e2bbd86322e31bf0"), contentType: 'NEWS', title: 'Sudanese flood streets a year after start of uprising that toppled Bashir', description: 'Tens of thousands of people took to the streets of Sudan on Thursday to celebrate the first anniversary of the start of the uprising that toppled long-time ruler Omar al-Bashir. Marchers gathered in different parts of the capital Khartoum and in the city of Atbara where protests began against dire economic conditions on December 19 last year.\n\n“Our martyrs have not died, they live with the revolutionaries!” marchers chanted in Khartoum, referring to people killed during demonstrations that led to the military deposing Bashir on April 11 after over three decades in power. \n\nAbout 10,000 people gathered in front of the Martyrs’ Centre in Khartoum, set up by the government for the families of people killed in protests. “Blood for blood, we won’t accept blood money!” they chanted, a rallying cry for justice for the protesters who were killed.\n\nA Sudanese court on Saturday convicted Bashir on corruption charges and sentenced him to two years of detention in a reform facility, the first ruling against the former president.Sudan is now run by transitional authorities under a three-year, power-sharing deal reached in August between the then-ruling military council and opposition and protest groups.', priceDetail: [], imageThumb: 'https://s3.eu-west-1.amazonaws.com/com.azamtv2019/SUDAN_1576822905-282bbe22bc1747aca3118ff57cc30b46.jpg', series: [], referenceChannelID: null, createdAt: new Date("Fri, 20 Dec 2019 20:20:25 GMT"), updatedAt: new Date("Fri, 20 Dec 2019 20:20:25 GMT"), __v: 0 }, { session: null })
